import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';


const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/become-seller" element={<BecomeSeller />} />
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
